import React from 'react';

function Footer() {
  const year = new Date().getFullYear();

  return (
    <footer className="footer bg-gray-200 py-4 text-center">
      <div className="container">
        <div className="row">
          <Column title="Mobile Apps" items={['Our Services', 'Price Trends', 'Post your Property']} />
          <Column title="Real Estate" items={['Real Estate Investments', 'Builders in India', 'Area Converter']} />
          <Column title="Information" items={['Articles', 'Rent Receipt', 'Customer Service', 'Sitemap']} />
          <Column title="Company" items={['About us', 'Contact us', 'Careers with us', 'Terms & Conditions', 'Request Info', 'Feedback', 'Report a problem', 'Testimonials', 'Privacy Policy']} />
        </div>
      </div>
      <h3 className="text-gray-600">Copyright â“’ {year}</h3>
    </footer>
  );
}

function Column({ title, items }) {
  return (
    <div className="col-md-3">
      <h3>{title}</h3>
      <ul>
        {items.map((item, index) => (
          <li key={index}><a href="#">{item}</a></li>
        ))}
      </ul>
    </div>
  );
}

export default Footer;
